# Initialize the grid for results (for first quadrant)
nm_results_grid = np.zeros((NB, NB))

# Fill the grid for the first quadrant
for i, (Bx, Bz) in enumerate(combs):
    result = nm_results_array[i]  # Read and convert to float
    ix = np.where(Bx_values == Bx)[0][0]
    iz = np.where(Bz_values == Bz)[0][0]
    nm_results_grid[ix, iz] = result

#Print options; should be kept enabled if one wants to print the data.
np.set_printoptions(threshold=sys.maxsize)

# Extend the grid to the full range by mirroring across both axes
full_nm_results_grid = np.zeros((2 * NB - 1, 2 * NB - 1))

# Fill in the first quadrant
full_nm_results_grid[NB-1:, NB-1:] = nm_results_grid

# Mirror to fill the fourth quadrant (+x, -y), skipping the first row, as if NB is odd,
# then the first row corresponds to the line x = 0, which shall not be reflected.
full_nm_results_grid[:NB-1, NB-1:] = np.flipud(nm_results_grid[1:])

# Mirror to fill the second quadrant (-x, +y), skipping the first column, as if NB is odd,
# then the first row corresponds to the line y = 0, which shall not be reflected.
full_nm_results_grid[NB-1:, :NB-1] = np.fliplr(nm_results_grid[:, 1:])

# Mirror to fill the third quadrant (-x, -y), skipping the first column, as if NB is odd,
# then the first row corresponds to the line y = 0, which shall not be reflected.
full_nm_results_grid[:NB-1, :NB-1] = np.flipud(np.fliplr(nm_results_grid[1:, 1:]))

# Define the new B ranges for plotting
